import React, { useState, useEffect } from 'react'
import { useParams } from 'react-router-dom';
import { getNoteById } from '../helpers';

export const NotePage = ({ props }) => {

  const { id } = useParams();
  const [singNote, setSingleNote] = useState({})
  useEffect(() => {
    getInitialData();
  })

  const getInitialData = async () => {
    const noteData = await getNoteById(noteId = id)
    console.log("data--", noteData);
    setSingleNote(noteData);
  }

  const showData = () => {
    return (
      <div>
        <h1>Note Id : {singNote?.id}</h1>
        <h1>Note Data : {singNote?.note_body}</h1>
        <h1>Created At : {singNote?.created_at}</h1>
        <h1>Updated At : {singNote?.updated_at}</h1>
      </div>
    )
  }

  return (
    <div>
      {!!singNote ? showData() : <h1>No Note </h1>}
    </div>
  )
}
